export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},"1eGEfO0JVk":{data:{id:1412,attributes:{imdbId:"tt0167190",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTc1ZWY0ZTEtZTVmNi00MTg0LTg4NmQtZTI4OWNiMmQ0MWZkXkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"81%"},{Source:"Metacritic",Value:"72\u002F100"}],item_lang:{data:{id:2075,attributes:{title:h,plot:"At the end of World War II, Nazi officers Karl Ruprecht Kroenen and Ilsa Haupstein start an experiment to raise the forces of Hell trough Russian dark mystic Rasputin on a Scottish island, but it's interrupted by an allied commando guided by professor Trevor \"Broom\" Bruttenholm. He prevents killing the human-demonic half-blood, which was accidentally created and raises this \"Hellboy\", while rising to head of a secret C.I.A.-linked U.S. agency Bureau of Paranormal Research, which secretly studies and uses the occult, including supernatural freaks. As \"father\" Broom is aging, he hand-picks brilliant, sensitive Agent John Myers as new minder-companion, as regular \"warrior\" Agent Clay can't empathize and lacks flexibility mental. Hellboy is quite a handful, regularly spotted by worried civilians on unauthorized excursions, especially to pyro-telekinetic freak friend in a mental asylum. Johnny, Hellboy, and Clay team up on missions against paranormal threats with aquatic-bionic freak Abe Sapien. Their task proves to be daunting, as monster Sammael multiplies every time it \"dies\", while Rasputin and the Nazis reemerge, armed for revenge.",slug:"hellboy"}}},books:{data:[{id:7538,attributes:{title:"Hellboy Omnibus Volume 4: Hellboy in Hell",description:"The Hellboy saga concludes, with the most ambitious chapter, Hellboy in Hell, collected in its entirety--all written and drawn by Mike Mignola. On the heels of Hellboy Omnibus Volume 3: The Wild Hunt, Hellboy is cast into Hell, where familiar faces reveal secrets of his origins, and previously unknown family members come forward. Hellboy forever alters the face of Hell, giving new significance to his role of Beast of the Apocalypse. While featuring big answers and one of the most momentous choices Hellboy's ever made, Hellboy in Hell also offers a return to the simplest and best Hellboy stories, as Hellboy roams a unique world only Mignola could present, filled with strange and magical encounters rich with the power of folklore and myth. The four volume Hellboy Omnibus series along with the two volumes of The Complete Short Stories collect all of Mignola's award-winning Hellboy stories in chronological order for a definitive reading experience.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3VdqDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2018-09-18",publisher:d,subtitle:a}},{id:7539,attributes:{title:"Hellboy Omnibus Boxed Set",description:"Hellboy's major story, available in a special box set for the first time featuring slipcase art by the creator himself! Previously available only as individual volumes, all four Hellboy series omnibuses (Seed of Destruction; Strange Places; The Wild Hunt; and Hellboy in Hell) are available together in a specially designed collection! Featuring an exclusive box with new art by Mike Mignola, expertly colored by Dave Stewart, this set is a marvel both inside and out. Experience the original series through new eyes with this boxed edition set, featuring story and art by Mike Mignola, Duncan Fegredo, Richard Corben, Dave Stewart, and more! Collects complete set of Hellboy omnibuses volumes 1-4.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6rVCEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,"John Byrne"],firstBook:e,published:"2021-11-09",publisher:d,subtitle:a}},{id:7540,attributes:{title:"Young Hellboy: The Hidden Land",description:"Even when Big Red was little, he had no shortage of daring adventures. Join Hellboy creator Mike Mignola as he teams with writer Tom Sniegoski, artist Craig Rousseau, and colorist Dave Stewart to bring you a tale of Hellboy's childhood, collected in a gorgeous hardcover edition! Stranded on a strange island after a mishap on their way to a South American dig site, Hellboy and Professor Bruttenholm are confronted by all manner of monsters on land, sea, and sky! A stranger who rescues them turns out to be one of Hellboy's heroes, but they still aren't as safe as they think they are! An old evil that the island protects is about to reawaken, drawing Hellboy and his new allies into a desperate battle!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MglAEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Thomas E. Sniegoski"],firstBook:e,published:"2021-10-05",publisher:d,subtitle:a}},{id:7541,attributes:{title:"Hellboy Omnibus Volume 2: Strange Places",description:"Hellboy's complete story is presented for the first time in chronological order for the ultimate reading experience. This 416-page volume covers Hellboy's adventures from 1998 to 2005, reprinting Conqueror Worm, Strange Places, Into the Silent Sea, and \"The Right Hand of Doom, \"Box Full of Evil,\" and \"Being Human\" from The Right Hand of Doom and B.P.R.D. Being Human. Hellboy loses faith in the Bureau for Paranormal Research and Defense when they strap a bomb to one of his fellow not-quite-human agents. He gets answers about his destiny, like it or not, in over 300 pages of comics mostly drawn by Mignola, featuring award-winning guests Gary Gianni and Richard Corben. The four volume Hellboy Omnibus series along with the two volumes of The Complete Short Stories collect all of Mignola's award-winning Hellboy stories in chronological order for a definitive reading experience.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Q6leDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:e,published:"2018-07-03",publisher:d,subtitle:a}},{id:7542,attributes:{title:h,description:"This new book and figure set is sure to appeal to comics fans, collectors, and those just discovering Hellboy through the motion-picture, Hellboy II: The Golden Army! Includes a Mike Mignola-inspired Hellboy figure (approximately 4\" tall) packaged in a colorfully-illustrated box with a new hardcover, digest-sized edition of Hellboy Volume 1: Seed of Destruction featuring an all-new cover by Hellboy creator, Mike Mignola! Clear windows showcase both items.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=oqVePgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2008-06-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377335361}}("","movie","Mike Mignola","Dark Horse Comics",null,"series",1,"Hellboy"))